import React from "react";
import { Navbar } from "react-bootstrap";

const ProjectHeader = () => {
  return (
    <>
      <Navbar expand="lg" bg="light">
        <Navbar.Text>
          &nbsp; <strong>Dashboard : Projects</strong>
        </Navbar.Text>
      </Navbar>
    </>
  );
};

export default ProjectHeader;
